DROP TABLE IF EXISTS `bookings`;
CREATE TABLE `bookings` (
  `booking_id` int NOT NULL AUTO_INCREMENT,
  `buyer_id` int DEFAULT NULL,
  `check_in_date` date NOT NULL,
  `check_out_date` date NOT NULL,
  `total_price` decimal(10,2) NOT NULL,
  `status` enum('cancelled','confirmed','completed','checked in','no show') DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `number_of_guests` int DEFAULT NULL,
  `hotel_id` int NOT NULL,
  `room_id` int NOT NULL,
  `quantity` int DEFAULT NULL,
  `booking_code` varchar(100) NOT NULL,
  PRIMARY KEY (`booking_id`),
  KEY `user_id` (`buyer_id`),
  KEY `hotel_id` (`hotel_id`),
  KEY `room_id` (`room_id`)
);

DROP TABLE IF EXISTS `fees`;
CREATE TABLE `fees` (
  `fee_id` int NOT NULL AUTO_INCREMENT,
  `transaction_id` int NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `percentage` decimal(5,2) NOT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`fee_id`),
  KEY `transaction_id` (`transaction_id`)
);

DROP TABLE IF EXISTS `hotels`;
CREATE TABLE `hotels` (
  `hotel_id` int NOT NULL AUTO_INCREMENT,
  `owner_id` int DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `description` text,
  `address` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `phone_number` varchar(30) DEFAULT NULL,
  `overall_rating` decimal(2,1) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `latitude` varchar(30) NOT NULL,
  `longitude` varchar(30) NOT NULL,
  `image_urls` text,
  `hotel_class` int DEFAULT NULL,
  `hotel_amenities` text,
  `check_in_time` varchar(30) DEFAULT NULL,
  `check_out_time` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`hotel_id`),
  UNIQUE KEY `coordinates` (`latitude`,`longitude`),
  KEY `owner_id` (`owner_id`)
);


INSERT INTO `hotels` VALUES (1,2,'22Land Residence Hotel','Tọa lạc gần địa danh nổi bật, 22Land Residence Hotel mang đến sự tiện nghi với phòng ốc hiện đại, Wi-Fi tốc độ cao, và các tiện ích khác như hồ bơi, spa,.... Thưởng thức các đặc sản ngay trong khách sạn và khám phá vẻ đẹp của các địa danh nổi tiếng chỉ với vài bước chân.','52 Ng. Huyện, Hàng Trống, Hoàn Kiếm, Hà Nội, Việt Nam','Hà Nội','+84 794 460 000',4.2,'2024-11-05 08:03:11','2024-12-16 13:11:50','21.029348799999998','105.84820520000001','[\"https://lh5.googleusercontent.com/p/AF1QipMLnynd55m32cgBrvnGaoqFG5H19TAibCwjD3Wg=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOwuPp2dyTIa3es1wtEsdmkM8DC91_JqXnxlupd=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOtpbdkCJ3IcDGlVnKqYLrDAliGcfDYCeSmJuCI=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipM7k4nGm39WMZQOm8T3sbYVjjJOT27WfF50JHd9=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMGoclVOg8e3joMaPOcz_NLtMqo02MeUcFHtuP1=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMHXaB2IQU7fwLF_lnEZUn8wVkseNW9bkpt4Gbm=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMWPdD2_xkidzQXbnHqEZeUitMPkAOYatVPWivQ=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMGXxuxLTyil_LLt90C82sV6xk-aRDPrcqhjhvP=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipPvkB3ynOvcROKNWY97gJ1mFw9zKws5cO8O0SyN=s10000\"]',NULL,'[\"Lễ tân 24/7\",\"Wi-Fi miễn phí\",\"Bãi đỗ xe\",\"Dịch vụ phòng\",\"Phòng tập thể dục\",\"Hồ bơi\",\"Nhà hàng\",\"Dịch vụ giặt là\",\"Dịch vụ đưa đón sân bay\"]','14:00','12:00'),(2,NULL,'Aira Boutique Hanoi Hotel & Spa','Khách sạn sang trọng này nằm trên một con phố mua sắm nhộn nhịp, cách hồ Hoàn Kiếm và chợ Đồng Xuân 7 phút đi bộ và ga Long Biên 10 phút đi bộ.\nPhòng ở thời thượng, lát sàn gỗ, có Wi-Fi miễn phí, TV màn hình phẳng, tủ lạnh nhỏ cùng dụng cụ pha trà và cà phê. Một số phòng có ban công. Phòng gia đình loại 2 phòng ngủ ở được tối đa 5 khách.\nNhà hàng trang nhã phục vụ bữa sáng tự chọn miễn phí. Tại đây còn có khu spa và phòng chờ sang trọng ở sảnh. Có chương trình tham quan và dịch vụ may đo (tính phí).','38A P. Trần Phú, Điện Biên, Ba Đình, Hà Nội 100000, Việt Nam','Hà Nội','+84 24 3935 2485',4.7,'2024-11-05 08:03:11','2024-11-05 08:03:11','21.0307215','105.84188080000001','[\"https://lh5.googleusercontent.com/p/AF1QipMzlSzUUMsPraflBlm1sSM4QF2pZkRb0ZapTpeg=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMkJOATOiFNFjVRjCNGtiIvp73xytQPllZ9I-mP=s10000\",\"https://cdn.worldota.net/t/1024x768/content/b5/c5/b5c5087cdf79a9c3092bc90165bc3178961f5f91.jpeg\",\"https://lh5.googleusercontent.com/p/AF1QipN6PgKgbgu-lKq4ipD1pNVl2IXTFGYq4AC3sqcU=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOEW6TbFhMF_LTjtbsCzBWMx9K6JO0YQ8dONcKx=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOWxBOhhSzY285SoZhy5S5RC_gLGp-3-_tVUhxZ=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipPNaqwH4cUUCU8h86Mazgh-6egXU5CASAS0ewDy=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipNYhA-oiRyREbLg0b9Lvque1Xqg_AGzKwzNalrW=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMG5NUGLrKH1eRodtprYya6ybGyCQhhkW0AHUL7=s10000\"]',3,'[\"Lễ tân 24/7\",\"Wi-Fi miễn phí\",\"Bãi đỗ xe\",\"Dịch vụ phòng\",\"Phòng tập thể dục\",\"Hồ bơi\",\"Nhà hàng\",\"Dịch vụ giặt là\",\"Dịch vụ đưa đón sân bay\"]','14:00','12:00'),(3,NULL,'22land Residence Hotel & Spa Hanoi','Tọa lạc gần địa danh nổi bật, 22land Residence Hotel & Spa Hanoi mang đến sự tiện nghi với phòng ốc hiện đại, Wi-Fi tốc độ cao, và các tiện ích khác như hồ bơi, spa,.... Thưởng thức các đặc sản ngay trong khách sạn và khám phá vẻ đẹp của các địa danh nổi tiếng chỉ với vài bước chân.','2 P. Nguyễn Đình Hoàn, Nghĩa Đô, Cầu Giấy, Hà Nội 10000, Việt Nam','Hà Nội','+84 774 065 555',4.4,'2024-11-05 08:03:11','2024-11-05 08:03:11','21.045847','105.80499189999999','[\"https://lh5.googleusercontent.com/p/AF1QipN02WMZtpg8fmibQCeVJtm60Fvrcy_kGT9wxfwT=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOH0o6fcZYALFu5Hsx-s4NKj17U139swuS4aRoJ=s10000\",\"https://lh5.googleusercontent.com