inh hoạt. Căn hộ loại 1 và 2 phòng ngủ có bếp, phòng ăn/phòng khách và nhìn ra toàn cảnh thành phố.\nTại đây có nhà hàng sang trọng, 3 quán bar (1 quán cạnh bể bơi, 1 quán trên tầng thượng), khu spa, phòng tập thể dục và phòng karaoke.','162 Bạch Đằng, Hải Châu 1, Hải Châu, Đà Nẵng 550000, Việt Nam','Đà Nẵng','+84 236 3222 999',4.3,'2024-12-15 18:16:29','2024-12-15 18:16:29','16.0667352','108.22465679999999','[\"https://dynamic-media-cdn.tripadvisor.com/media/photo-o/13/57/08/dc/brilliant-top-bar.jpg?w=2100&h=1400&s=1\",\"https://lh5.googleusercontent.com/p/AF1QipMLpxs5-k36029XPKpArVb7ExLMSpJnom5PBA9p=s10000\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/3/0/76/836/574/two_bedroom_apt_twin_O.jpg\",\"https://lh5.googleusercontent.com/p/AF1QipM_AkFdra90IWcRecmQCqzz3Sjt8KIfYuvt0CKK=s10000\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/5/0/90/812/63/Deluxe_Twin_River_View_S.jpg\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/3/0/76/836/510/Deluxe_Double_O.jpg\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/5/0/90/855/795/deluxe_bathroom_O.jpg\",\"https://lh5.googleusercontent.com/p/AF1QipN_rvz5plrd5Nbf3IiKtUrFVUxB0CmAp1HonfvN=s10000\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/5/0/90/812/157/Buffet_S.jpg\"]',4,'[\"Lễ tân 24/7\",\"Wi-Fi miễn phí\",\"Bãi đỗ xe\",\"Dịch vụ phòng\",\"Phòng tập thể dục\",\"Hồ bơi\",\"Nhà hàng\",\"Dịch vụ giặt là\",\"Dịch vụ đưa đón sân bay\"]','14:00','12:00'),(117,NULL,'Khách sạn Samdi','Khách sạn ấm cúng này nằm giữa các nhà hàng và cửa hiệu bán lẻ trong thành phố có những ngọn núi bao quanh, hướng ra Hồ Công viên 29/3. Cách Sân bay Quốc tế Đà Nẵng chưa đến 1 km và bãi biển Mỹ Khê 5 km.\nPhòng ốc sang trọng mang phong cách cổ điển, có Wi-Fi miễn phí, TV màn hình phẳng, két an toàn và tủ lạnh nhỏ. Tất cả phòng đều có tầm nhìn hướng ra thành phố, hồ, núi và/hoặc biển. Phòng suite có thêm khu tiếp khách riêng và phòng tắm vách kính. Căn hộ loại 2 phòng ngủ có phòng bếp và không gian ăn uống.\nCác tiện nghi miễn phí ba