, Lộc Thọ, Nha Trang, Khánh Hòa 650000, Việt Nam','Nha Trang','+84 394 156 768',4.7,'2024-12-15 18:22:05','2024-12-15 18:22:05','12.2348242','109.1963373','[\"https://lh5.googleusercontent.com/p/AF1QipPdNHfp7R-fV1Y5-Is3nPfImpAg0twZ9wTRrgIf=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipP84nkmo1vjZBwuDnDJjSLSkjlzcgMy5mc80wxS=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMSn2RfLX7v0ugCp4vDnrtmHQWP63xwlQrdCqJR=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipM4mG1_6_wmz_G6c6K6Mw4rRZWo_jFuT3CKqiO6=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMXtr48lu1sOqmDaDDy5bpSL-Y-xsrj7ZZr1QjZ=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipNhsMXs23-VZ8uOiGqe-SP4gc5yY_4Rm1L3qKt3=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMqtna1f8754rNQnAK3Fa6uiodGBQhxrigT5jl1=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipMRhsyBP8WF4iG1AliFR7TKpLyTVKBEEWHEpsng=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOiRERTixnXQExdbBgwbiiyCEmcWrNdVr0T5-Yp=s10000\"]',4,'[\"Lễ tân 24/7\",\"Wi-Fi miễn phí\",\"Bãi đỗ xe\",\"Dịch vụ phòng\",\"Phòng tập thể dục\",\"Hồ bơi\",\"Nhà hàng\",\"Dịch vụ giặt là\",\"Dịch vụ đưa đón sân bay\"]','14:00','12:00'),(132,NULL,'Dendro Gold','Khách sạn bình dân trong một tòa cao ốc nhìn ra biển, cách bãi biển Nha Trang 5 phút đi bộ, cách Chùa Long Sơn 4 km và cách Cảng hàng không quốc tế Cam Ranh 35 km.\nPhòng ở thư thái có Wi-Fi miễn phí, TV màn hình phẳng, két sắt, tủ lạnh nhỏ cùng dụng cụ pha trà và cà phê. Nhiều phòng có thêm ban công riêng và/hoặc tầm nhìn ra biển. Khách sạn có dịch vụ phòng 24/7.\nKhách sạn phục vụ bữa sáng miễn phí tại một nhà hàng tự chọn bình dân. Các tiện nghi khác bao gồm spa, phòng tập thể dục cùng bể bơi ngoài trời có quầy bar và khu vui chơi cho trẻ em trên tầng 4. Tại đây cũng có bãi tắm riêng. Khách sạn có chỗ đỗ xe.','Trần Phú, Lộc Thọ, Nha Trang, Khánh Hòa 650000, Việt Nam','Nha Trang','+84 866 464 979',4.0,'2024-12-15 18:22:05','2024-12-15 18:22:05','12.2288976','109.1970949','[\"https://lh5.goog