'Khách sạn sang trọng, thời thượng này đối diện Vịnh Nha Trang và cách Tháp Bà Po Nagar 3 km.\nPhòng ở sành điệu có ban công riêng và các tác phẩm nghệ thuật màu sắc rực rỡ, có trang bị Wi-Fi miễn phí, TV màn hình phẳng, két sắt, tủ lạnh nhỏ và dụng cụ pha trà, cà phê. Các phòng cao cấp hơn cho phép khách vào khu lounge cao cấp. Phòng suite có phòng khách riêng, còn phòng suite cao cấp hơn được trang bị cả bếp nhỏ, phòng tắm xông hơi và bồn tắm sục. Ngoài ra khách sạn còn có suite trên tầng thượng và các căn hộ 2 phòng ngủ. Nơi đây có dịch vụ phòng 24/7.\nKhách sạn phục vụ bữa sáng và có chỗ đỗ xe miễn phí. Nơi đây có 6 nhà hàng và quán bar, trong đó có một quán bar trên sân thượng, bên cạnh còn có một bể bơi vô cực ngoài trời, một phòng spa và một phòng tập thể hình.','26-28 Trần Phú, Lộc Thọ, Nha Trang, Khánh Hòa 650000, Việt Nam','Nha Trang','+84 258 3880 000',4.6,'2024-12-15 18:22:05','2024-12-15 18:22:05','12.2463429','109.1961206','[\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/3/0/180/176/835/si-nhasi-altitude-rooftop-bar24297-65429_Classic-Hor_O.jpg\",\"https://lh5.googleusercontent.com/p/AF1QipMfc6WpWD_XH4tgNFUzN1RtIMyatEGfqTbLfadK=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipNki_f3ur6zn4rin_Xs2vwOJF-zVyzOdPSiHgKG=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipOUQDp9__dXzsxegD9cS_HtSCrSK-aIfWFv7STZ=s10000\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/3/0/180/176/633/si-nhasi-executive-suite-bath40420-25089_Classic-Hor_O.jpg\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/3/0/180/176/943/si-nhasi-infinity-pool-32377_Classic-Hor_O.jpg\",\"https://d2hyz2bfif3cr8.cloudfront.net/imageRepo/3/0/180/176/435/si-nhasi-presidential-suite-32738_Classic-Hor_O.jpg\",\"https://lh5.googleusercontent.com/p/AF1QipOk7nIEPlYhKiAx_piYPycUrJ2Sd_xSZ3yJWb7e=s10000\",\"https://lh5.googleusercontent.com/p/AF1QipNC1fHpNRg4n657wY01VMGZ6PsAQRwtbgBknTZ8=s10000\"]',5,'[\"Lễ tân 24/7\",\"Wi-Fi miễn phí\",\"Bãi đỗ xe\",\"Dịch vụ phòng\",\"Phòng tập thể dục\",\"H