DROP TABLE IF EXISTS `notifications`;
CREATE TABLE `notifications` (
  `notification_id` int NOT NULL AUTO_INCREMENT,
  `sender_id` int NOT NULL,
  `notification_type` varchar(50) DEFAULT NULL,
  `message` text NOT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `is_read` tinyint(1) DEFAULT NULL,
  `reciever_id` int NOT NULL,
  PRIMARY KEY (`notification_id`),
  KEY `notifications_ibfk_1_idx` (`reciever_id`),
  KEY `sender_id_idx` (`sender_id`)
);

DROP TABLE IF EXISTS `payments`;
CREATE TABLE `payments` (
  `payment_id` int NOT NULL AUTO_INCREMENT,
  `transaction_id` int NOT NULL,
  `payment_method` varchar(50) DEFAULT NULL,
  `payment_status` enum('pending','success','failed') NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `currency` varchar(10) NOT NULL,
  `paid_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`payment_id`),
  KEY `transaction_id` (`transaction_id`)
);

DROP TABLE IF EXISTS `refunds`;
CREATE TABLE `refunds` (
  `refund_id` int NOT NULL AUTO_INCREMENT,
  `transaction_id` int NOT NULL,
  `buyer_id` int NOT NULL,
  `hotel_id` int NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `status` enum('pending','completed','rejected') NOT NULL,
  `requested_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `completed_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`refund_id`),
  KEY `transaction_id` (`transaction_id`),
  KEY `buyer_id` (`buyer_id`),
  KEY `refunds_ibfk_3_idx` (`hotel_id`)
);

DROP TABLE IF EXISTS `review_criterias`;
CREATE TABLE `review_criterias` (
  `review_score_id` int NOT NULL AUTO_INCREMENT,
  `review_id` int NOT NULL,
  `criteria_name` varchar(50) NOT NULL,
  `score` int DEFAULT NULL,
  PRIMARY KEY (`review_score_id`),
  KEY `review_scores` (`review_id`)
);


INSERT INTO `review_criterias` VALUES (7,769,'Cleanliness',3),(8,769,'Staff',4),(9,769,'Facilities',4),(10,769,'Comfort',4),(11,769,'Location',4),(12,769,'Value for money',4),(13,770,'Cleanliness',4),(14,770,'Staff',4),(15,770,'Facilities',4),(16,770,'Comfort',4),(17,770,'Location',4),(18,770,'Value for money',4);


DROP TABLE IF EXISTS `reviews`;

CREATE TABLE `reviews` (
  `review_id` int NOT NULL AUTO_INCREMENT,
  `user_id` int DEFAULT NULL,
  `hotel_id` int DEFAULT NULL,
  `rating` decimal(2,1) NOT NULL,
  `comment` text,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `booking_code` varchar(100) DEFAULT NULL,
  `reply` text,
  `number_of_likes` int DEFAULT (0),
  `number_of_dislikes` int DEFAULT (0),
  PRIMARY KEY (`review_id`),
  KEY `user_id` (`user_id`),
  KEY `hotel_id` (`hotel_id`)
);


