DROP TABLE IF EXISTS `transactions`;
CREATE TABLE `transactions` (
  `transaction_id` int NOT NULL AUTO_INCREMENT,
  `buyer_id` int NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `currency` varchar(10) NOT NULL,
  `status` enum('pending','completed','cancelled') NOT NULL,
  `transaction_type` enum('booking_payment','refund') NOT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `payment_intent_id` varchar(50) DEFAULT NULL,
  `hotel_id` int DEFAULT NULL,
  `charge_id` varchar(100) DEFAULT NULL,
  `booking_code` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`transaction_id`),
  KEY `buyer_id` (`buyer_id`),
  KEY `fk_transactions_hotel_id` (`hotel_id`)
);


DROP TABLE IF EXISTS `user_notifications`;
CREATE TABLE `user_notifications` (
  `notification_id` int NOT NULL AUTO_INCREMENT,
  `sender_id` int NOT NULL,
  `notification_type` varchar(50) DEFAULT NULL,
  `message` text,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `is_read` tinyint(1) DEFAULT NULL,
  `reciever_id` int NOT NULL,
  PRIMARY KEY (`notification_id`),
  KEY `reciever_id` (`reciever_id`)
);

DROP TABLE IF EXISTS `users`;  
CREATE TABLE `users` (
  `user_id` int NOT NULL AUTO_INCREMENT,
  `username` varchar(255) DEFAULT NULL,
  `email` varchar(255) NOT NULL,
  `password_hash` varchar(255) DEFAULT NULL,
  `full_name` varchar(255) DEFAULT NULL,
  `phone_number` varchar(15) DEFAULT NULL,
  `user_role` enum('customer','partner','admin') DEFAULT 'customer',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `connect_account_id` varchar(255) DEFAULT NULL,
  `address` text,
  `country` varchar(255) DEFAULT NULL,
  `profile_picture_url` text,
  `date_of_birth` date DEFAULT NULL,
  `gender` enum('male','female') DEFAULT NULL,
  `nationality` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `unique_email_role` (`email`,`user_role`),
  UNIQUE KEY `connect_account_id_UNIQUE` (`connect_account_id`)
);

DROP TABLE IF EXISTS `viewed_hotels`;
CREATE TABLE `viewed_hotels` (
  `view_id` int NOT NULL AUTO_INCREMENT,
  `user_id` int DEFAULT NULL,
  `hotel_id` int DEFAULT NULL,
  `viewed_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`view_id`),
  KEY `user_id` (`user_id`),
  KEY `hotel_id` (`hotel_id`),
  CONSTRAINT `viewed_hotels_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`),
  CONSTRAINT `viewed_hotels_ibfk_2` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`)
);

ALTER TABLE `bookings` ADD FOREIGN KEY (`buyer_id`) REFERENCES `users` (`user_id`);
ALTER TABLE `bookings` ADD FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`);
ALTER TABLE `bookings` ADD FOREIGN KEY (`room_id`) REFERENCES `rooms` (`room_id`);
ALTER TABLE `fees` ADD CONSTRAINT `fees_ibfk_1` FOREIGN KEY (`transaction_id`) REFERENCES `transactions` (`transaction_id`) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE `saved_hotels` ADD CONSTRAINT `fk_user` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE CASCADE;

ALTER TABLE `saved_hotels` ADD CONSTRAINT `fk_hotel` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`) ON DELETE CASCADE;
ALTER TABLE `user_notifications` ADD CONSTRAINT `user_notifications_ibfk_1` FOREIGN KEY (`reciever_id`) REFERENCES `users` (`user_id`);

ALTER TABLE `invoices` ADD CONSTRAINT `invoices_ibfk_2` FOREIGN KEY (`transaction_id`) REFERENCES `transactions` (`transaction_id`);
ALTER TABLE `invoices` ADD CONSTRAINT `invoices_ibfk_4` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`);
ALTER TABLE `nearby_places` ADD CONSTRAINT `nearby_places_ibfk_1` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`);

ALTER TABLE `user_notifications` ADD CONSTRAINT `reciever_id` FOREIGN KEY (`reciever_id`) REFERENCES `hotels` (`hotel_id`);
ALTER TABLE `user_notifications` ADD CONSTRAINT `sender_id` FOREIGN KEY (`sender_id`) REFERENCES `users` (`user_id`);

ALTER TABLE `payments` ADD CONSTRAINT `payments_ibfk_1` FOREIGN KEY (`transaction_id`) REFERENCES `transactions` (`transaction_id`);

ALTER TABLE `refunds` ADD CONSTRAINT `refunds_ibfk_1` FOREIGN KEY (`transaction_id`) REFERENCES `transactions` (`transaction_id`);
ALTER TABLE `refunds` ADD CONSTRAINT `refunds_ibfk_2` FOREIGN KEY (`buyer_id`) REFERENCES `users` (`user_id`);
ALTER TABLE `refunds` ADD CONSTRAINT `refunds_ibfk_3` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`);

ALTER TABLE `review_criterias` ADD CONSTRAINT `review_criterias_ibfk_1` FOREIGN KEY (`review_id`) REFERENCES `reviews` (`review_id`);

ALTER TABLE `reviews` ADD CONSTRAINT `reviews_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`);
ALTER TABLE `reviews` ADD CONSTRAINT `reviews_ibfk_2` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`);
ALTER TABLE `reviews` ADD CONSTRAINT `reviews_chk_1` CHECK (`rating` BETWEEN 1.0 AND 5.0);
ALTER TABLE `room_inventory` ADD CONSTRAINT `room_inventory_ibfk_1` FOREIGN KEY (`room_id`) REFERENCES `rooms` (`room_id`);
ALTER TABLE `rooms` ADD CONSTRAINT `rooms_ibfk_1` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`hotel_id`)